import React from "react";
import ProductDetails from "./ProductDetails";
import { Link } from "react-router-dom";

function Product({imgurl,price,title,category,sku}){
    return (
        <div className="bg-grey-500 p-2 rounded-md">
            <img src={imgurl} className="w-20"/>
            <div>{price}</div>
            <div>{title}</div>
            <div>{category}</div> 

    <Link to={"/products/" + sku} >view details</Link>
       </div>
    );
}

export default Product;
